# Parse the HTML content
soup = BeautifulSoup(HTML_CONTENT, 'html.parser')

# Find the table containing the grade records
GRADE_TABLE = soup.find('table', class_='table-striped')




# Extract grade records from the table
grade_records = []

# Extract Credit Hours records from the table
credit_hours = []

# Extract Subject Names
course_names = []

if GRADE_TABLE:
    # Iterate through each row of the table
    for row in GRADE_TABLE.find_all('tr'):
        # Get all the table data (td) elements in this row
        cols = row.find_all('td')
        # Extract the grade value from the 7th column (index 6)
        if len(cols) > 6:  # Ensure there are enough columns
            grade = cols[6].get_text().strip()
            grade_records.append(grade)

        if len(cols) > 3:
            credit_hour = int(cols[3].get_text().strip())
            credit_hours.append(credit_hour)

        if len(cols) > 1:
            course_name = cols[1].get_text().strip()
            course_names.append(course_name)


# grade_records = grade_records[:-7]
# credit_hours = credit_hours[:-7]

# grade_records[-1] = 'B'
# grade_records[-2] = 'B'
# grade_records[-3] = 'B'
# grade_records[-4] = 'B'
# grade_records[-5] = 'B'
# grade_records[-6] = 'B'
# grade_records[-8] = 'A+'
# credit_hours[-3] = 6

# Print the extracted grade records
print(grade_records)

for i in range(len(grade_records)):
    if grade_records[i] == 'Abs' or grade_records[i] == '' or grade_records[i] == 'Con' or course_names[i] == 'Field Training':
        credit_hours[i] = 0

    if course_names[i] == 'Graduation Project' and grade_records[i] != 'Con':
        credit_hours[i] = 6

print(credit_hours)
print(sum(credit_hours))


# Calculate GPA
total_credit_hours = sum(credit_hours)

weighted_sum = sum(GRADES_WEIGHTS[grade] * credit_hour
                   for grade, credit_hour in zip(grade_records, credit_hours)
                   if grade != 'Abs' and grade != '' and grade != 'Con')


GPA = weighted_sum / total_credit_hours
print(f"GPA: {GPA:.2f} ")


